const index = resolve => {
  import('./index/index.vue').then(module => {
    resolve(module)
  })
}
const detail = resolve => {
  import('./detail/index.vue').then(module => {
    resolve(module)
  })
}
const complain = resolve => {
  import('./complain/index.vue').then(module => {
    resolve(module)
  })
}
const articleCollection = resolve => {
  import('./collection').then(module => {
    resolve(module)
  })
}
const classify = resolve => {
  import('./classify/index.vue').then(module => {
    resolve(module)
  })
}

export default [{
    path: '/article',
    redirect: '/article/index'
  },
  {
    path: '/article/index',
    name: 'articleIndex',
    component: index,
    meta: {
      title: '文库',
      keepAlive: true
    }
  },
  {
    path: '/article/detail/:id',
    component: detail,
    meta: {
      title: '文章详情'
    }
  },
  {
    name: 'detail',
    path: '/article/detail/:id/:shareId',
    component: detail,
    meta: {
      title: '文章详情'
    }
  },
  {
    path: '/article/complain',
    component: complain,
    meta: {
      title: '投诉',
      auth: true
    }
  },
  {
    name: 'articleCollection',
    path: '/article/collection',
    component: articleCollection,
    meta: {
      nav: false,
      auth: true,
      title: '收藏文章',
      keepAlive: true
    }
  },
  {
    path: '/article/classify',
    component: classify,
    meta: {
      nav: false,
      auth: false,
      title: '所有栏目',
      keepAlive: true
    }
  }
